--
-- Name: vista_empleados_tareas; Type: VIEW; Schema: recursos_humanos; Owner: postgres
--

CREATE VIEW recursos_humanos.vista_empleados_tareas AS
 SELECT e.id_empleado,
    e.first_name AS nombre,
    e.last_name AS apellidos,
    e.email AS correo,
    e.especialidad,
    e.sueldo,
    e.is_active AS activo,
    e.foto,
    e.username AS nombre_usuario,
    e.password AS contrasenia,
    e.fecha_contratacion,
    e.area_id,
    e.rol_id,
    e.geom,
    array_agg(DISTINCT p.proyecto_id) AS proyectos_ids,
    count(t.tarea_id) FILTER (WHERE ((t.estado)::text = ANY (ARRAY[('Pendiente'::character varying)::text, ('En Progreso'::character varying)::text]))) AS cantidad_tareas_pendientes_o_en_progreso
   FROM (((recursos_humanos.empleados e
     LEFT JOIN tareas.asignaciones_tareas at ON ((e.id_empleado = at.empleado_id)))
     LEFT JOIN tareas.tareas t ON ((at.tarea_id = t.tarea_id)))
     LEFT JOIN proyectos.proyectos p ON ((t.proyecto_id = p.proyecto_id)))
  GROUP BY e.id_empleado, e.first_name, e.last_name, e.email, e.especialidad, e.sueldo, e.is_active, e.foto, e.username, e.password, e.fecha_contratacion, e.area_id, e.rol_id, e.geom;


ALTER VIEW recursos_humanos.vista_empleados_tareas OWNER TO postgres;

