-- Name: vista_notificaciones_empleados; Type: VIEW; Schema: sistemas; Owner: postgres
--

CREATE VIEW sistemas.vista_notificaciones_empleados AS
 SELECT e.id_empleado,
    e.first_name AS nombre_empleado,
    e.last_name AS apellido_empleado,
    n.id_notificacion,
    n.titulo AS titulo_notificacion,
    n.descripcion AS descripcion_notificacion,
    n.fecha_creacion,
    n.fecha_evento,
    n.tipo AS tipo_notificacion,
    n.estado AS estado_notificacion
   FROM ((sistemas.notificaciones n
     JOIN sistemas.notificaciones_destinatarios nd ON ((n.id_notificacion = nd.id_notificacion)))
     LEFT JOIN recursos_humanos.empleados e ON ((nd.empleado_id = e.id_empleado)))
  WHERE ((n.estado)::text = 'Activa'::text);


